import React from 'react';

function MoodList({ moods }) {
    return (
        <div>
            <h2>Today's Mood</h2>
            {moods.length === 0 ? (
                <p>No mood logged for today.</p>
            ) : (
                moods.map((mood, index) => (
                    <div key={index}>
                        <h3>{mood.mood}</h3>
                        <p>{mood.description}</p>
                        <p>Time of Day: {mood.timeOfDay}</p>
                    </div>
                ))
            )}
        </div>
    );
}

export default MoodList;
